              <h2>POC WebRTC Streaming</h2>
              <Link to="/register">Register here</Link>
            </div>
          ) : (user && (
            <div className="no-user-message">
              <h2>You are logged in</h2>
            </div>
          ))}
        </div>
      );
    }
  }
}

